// Extends ProfileList //
export default function ProfileListItem({style, data, setFocused}) {
  const handleFocus = (e, type) => {
    // refactor this and remove if statements //
    if (e.target.style.cursor !== "pointer") return
    if (type === "mac") type = "phones"
    if (type === "id") type = "subscribers"
    if (type === "extension") type = "lines"
    if (type === "voicemail") type = "voicemail"
    if (type === "did") type = "did"
    if (type === "las") type = "las"
    setFocused([e.target.innerHTML, type])
  }

  const renderListItemSubContent = () => {
    return (
      <div style={{display: "flex", width: "100%", marginLeft: "10px"}}>

        {data.slice(1).map((item, i) => (
            <div key={`LData${i}`} style={style.listItemDataOther}>{item['data']}</div>
        ))}
      </div>
    )
  }

  return (
    <div 
        style={style.listItemContainer}
        onClick={(e) => {handleFocus(e, data[0]['type'])}}
        // onMouseEnter={(e) => {
        //   e.currentTarget.style.border = "1px solid #063b50"  
        // }}
        // onMouseLeave={(e) => {
        //   e.currentTarget.style.border = ""
        // }}
        >
      <div style={style.listItemDataMain}>{data[0]['data']}</div>
      {renderListItemSubContent()}
    </div>
  )
}
